import React from 'react'
import { useState } from 'react'
import { useEffect } from 'react'
const Pagination = () => {

    const [letApi, setLetApi] = useState([])
    const [currentpage, setCurrentpage] = useState(1)

    const [blogerspage, setBlogerspage] = useState(20)

    const firstpage = currentpage*blogerspage

    const lastpage = firstpage-blogerspage

    const newpeginationAnswer= letApi.slice(lastpage,firstpage)
    useEffect(() => {
      fetch('https://jsonplaceholder.typicode.com/posts')
      .then(response => response.json())
      .then(data => setLetApi(data))
    
    },[])
    
    const firstp =()=>{
      const [currentpage, setCurrentpage] = useState(2)

      const [blogerspage, setBlogerspage] = useState(20)
      const newpeginationAnswer= letApi.slice(lastpage,firstpage)
    }
  return (

         <div>
            <div>
            {newpeginationAnswer.map(({id,title,body})=>{
            return(
                
                <div key={id}>
                    <div style={{background:'pink '}}>  
                    <h1>{id}</h1>
                    <h1>{title}</h1>
                    <h1>{body}</h1>
                </div>
                </div>

            )
         })}
         </div> 
         <div>
            <button onClick={firstp}>firstpage</button>
            <button>secondpage</button>
            <button>Thirdpage</button>
            <button>Forthpage</button>
         </div>
         </div>   
         
            


    
  )
}

export default Pagination
